import React, { Component } from 'react'
import { BoxContainer, Box_minImg, Box_mini_img1, Box_mini_img2, Box_mini_img3, Textboxmini, Text_mini1, } from './box_m.js';
import flowers1 from '../../Assets/menu_end1.png'
import flowers2 from '../../Assets/menu_end2.png'
import flowers3 from '../../Assets/menu_end3.png'




export default class Box_m extends Component {
  render() {
    return (
<BoxContainer>
<Textboxmini>We have lots of plants collection for you and your family <Text_mini1>See all collection</Text_mini1> </Textboxmini>
<Box_minImg>

          <Box_mini_img1 src={flowers1}/>
          <Box_mini_img2 src={flowers2} />
          <Box_mini_img3 src={flowers3} />


</Box_minImg>

</BoxContainer>
    )
  }
}
